import imdb from "../assets/imdb.png";
import styles from "../App.module.css";
import menu from "../assets/menu.gif";

function SearchBar() {
	return (
		<>
		<img src={imdb} className={styles.imdb} />
		<div className={styles.menu}> Menu</div>
		</>
	);
};

export default SearchBar;
